import React from "react";
import "./Menu.css";

const Menu = () => {
  return (
    <div className="menu">
      <ul>
        <li>
          <a href="#">Secrets</a>
        </li>
        <li>
          <a href="#">Classement</a>
        </li>
        <li>
          <a href="#">Participants</a>
        </li>
      </ul>
    </div>
  );
};

export default Menu;
